import './Expenses.css'
import ExpenseItem from './ExpenseItem';
import ExpenseDate from './ExpenseDate';

function Expenses(props) {


    return (
        <section className='expenses'>
        <h2>Let's get started!</h2>
        <ExpenseItem date="props"
          title={props.title}
          amount={props.amount}
          date={props.date}
        ></ExpenseItem>
        <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}></ExpenseItem>
        <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}></ExpenseItem>
        <ExpenseItem
        title={props.title}
        amount={props.amount}
        date={props.date}></ExpenseItem>
        
      </section> 
    )
}


export default Expenses;
